import React from "react";
import "./LandingPage.css";

const LandingPage = () => {
  return (
    <>
      <div className="landing-page">
        <h3 className="title"></h3>

        <div className="buttons">
          <a href="#" className="register">
            Register
          </a>
          <a href="#" className="check-in">
            Check-in
          </a>
        </div>
      </div>
    </>
  );
};

export default LandingPage;
